function InitApp(n,t,i,r,u){const f=Vue.createApp({data(){return{blocks:[],editable:r,toggleable:u,toggling:!1}},components:{BlocksEditor},methods:{isEditable(){return this.toggleable?this.toggling:this.editable},getBlocks(){_yemon[t].service.getData("/GetItem",{name:"blockscontent:"+i},n=>{this.blocks=[],n.data&&(this.blocks=JSON.parse(n.data)),this.$forceUpdate()})},changed(n){n&&_yemon[t].service.postData("/SetItem",{name:"blockscontent:"+i,value:JSON.stringify(n),keephistory:!1},n=>{n.status!=200&&toastr.error("Erreur")})}},mounted(){this.getBlocks()}});f.component("cropper",VueAdvancedCropper.Cropper);f.mount("#"+n)}